column8:
シルク100％のネックカバーで首もとを華やかに…首もとのたるみ等のお悩み、日よけにも使えます。肌触りがよく、メッシュ地で蒸れずに快適です。サッとかぶるだけで首もとがオシャレに変身！手洗いできるからいつも清潔を保てます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><br /><td><font color="#333333" size="-1">シルク100％のネックカバーで首もとを華やかに…首もとのたるみ等のお悩み、日よけにも使えます。肌触りがよく、メッシュ地で蒸れずに快適です。サッとかぶるだけで首もとがオシャレに変身！手洗いできるからいつも清潔を保てます。</font></td><br /></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><br /><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">約横19.5～27×長29cm 個装：18×16×0.5cm</font></td><br /></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><br /><td align="left"><p><font color="#333333" size="-1">8g</font></p></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><br /><td align="left"><font color="#333333" size="-1">ブラック、ラベンダー</font></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><br /><td align="left"><font color="#333333" size="-1">絹</font></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br /><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
